import React, { Component } from 'react';
import {Grid, Cell} from 'react-mdl';

class Resume extends Component {
    render() {
        return(
            <div >
                <Grid>
                    <Cell col={4}>
                        <div style={{textAlign: 'center'}}>
                            <img 
                            src={"/profile_pic.png"}
                            alt="avatar"
                            style={{height: '400px'}}

                            />
                        </div>
                    </Cell>
                    <Cell className="resume-right-col" col={8}>right side</Cell>
                </Grid>
            </div>
        )
    }
}

export default Resume;
